var X=(flow.get("X")||4)-1;
var Y=(flow.get("Y")||3)-1;


if(msg.payload.key=="LEFT" && (X>0)){
    X=X-1;
}

if(msg.payload.key=="RIGHT" && (X<7)){
    X=X+1;
}
if(msg.payload.key=="UP" && (Y>0)){
    Y=Y-1;
}
if(msg.payload.key=="DOWN" && (Y<7)){
    Y=Y+1;
}

flow.set("X",X+1);
flow.set("Y",Y+1);

var msg1 = { payload:"*,*,black" };
var msg2 = { payload: `${X},${Y},blue`};

return [msg1,msg2];

var    servoXMin=200; //  The commented numbers are for the old pan/tilt set
var    servoXMax=520; // 
var    servoXMid=330; // 360
var    servoYMin=235; //
var     servoYMax=520; //
var    servoYMid=300; // 320

var increment=2;

if(msg.payload.key=="ENTER"){
    msg.payload="JAW_MOTION, 1, 1"; 
    return msg;
}

var SX=(flow.get("SX"))||servoXMid;
var SY=(flow.get("SY"))||servoYMid;

if(msg.payload.key=="LEFT" && (SX>servoXMin)){
    SX=SX-increment;
}

if(msg.payload.key=="RIGHT" && (SX<servoXMax)){
    SX=SX+increment;
}
if(msg.payload.key=="UP" && (SY>servoYMin)){
    SY=SY-increment;
}
if(msg.payload.key=="DOWN" && (SY<servoYMax)){
    SY=SY+increment;
}

flow.set("SX",SX);
flow.set("SY",SY);

var msg1 = { payload:util.format("SERVOS_MOVE,%d,%d,7",SX,SY) };

return msg1;

