var xpart=msg.payload[0];
var ypart=msg.payload[1];

if (!(Math.abs(xpart) > 100 || Math.abs(ypart)>100)){
    msg.payload.key=""
} else {
    if (Math.abs(xpart)>Math.abs(ypart)){ 
        if(xpart<0)
            msg.payload.key="LEFT";
        else 
            msg.payload.key="RIGHT";
    } else {
        if(ypart<0)
            msg.payload.key="UP";
        else 
            msg.payload.key="DOWN";
    }
}

return msg;

